INSERT INTO `utility_globalsettings` (`id`, `created_at`, `updated_at`, `site_name`, `website_url`, `about_us_text`, `delivery_information`, `privacy_policy`, `terms_and_condition`, `search_terms`, `return_and_refund`, `email`, `phone`, `address`, `about_us_image_id`, `logo_id`, `payment_method_images_id`, `qr_code_id`, `qr_code2_id`) VALUES
(1, '2023-06-22 09:30:46.023515', '2023-09-11 06:23:49.432527', 'Kaaruj', 'http://kaaruj.backend.clients.devsstream.com/admin/utility/globalsettings/add/', '<h5 class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">What can we do for you ?</strong></h5><p class=\"ql-align-justify\"><strong style=\"color: rgb(247, 107, 106); background-color: rgb(252, 252, 252);\">Returns &amp; Exchanges</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">We believe that sometimes customers tend to get confused about purchasing the right lifestyle item that might not suit their interest. Keeping this in mind, Kaaruj has come up with the solution of providing the finest return policy that is helpful for our customers. If any of our customers are not satisfied with the product quality or might have gotten the wrong one, they can immediately return the product along with the delivery invoice and delivery charge to the delivery man. Therefore, customers surely need to check the product right in front of the delivery man. The Items that will be returned must be unworn, unwashed and unused with all original tags attached with the product.&nbsp;</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(247, 107, 106); background-color: transparent;\">What qualifies as a Return?</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Any product would qualify as a </span><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">“Return” </strong><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">if it meets any of the following conditions:</span></p><ul><li class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Wrong product, size, or color</span></li><li class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Damaged product</span></li><li class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Product lost in shipment</span></li><li class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Products with major quality defects</span></li></ul><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">If any of the conditions are found, Kaaruj will be paying the delivery charge for the product.</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(247, 107, 106); background-color: transparent;\">Customer Care (24/7)</strong></p><h4 class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">Mobile 1: (+88)-01735-11161</strong></h4><h5 class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">Careers:&nbsp;</strong></h5><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">If you’re interested in employment opportunities at Kaaruj Bangladesh, please email us at: hrd.kaaruj</span><a href=\"mailto:contact@kaaruj.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204); background-color: transparent;\">@kaaruj.com</a><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">&nbsp;</span></p>', '<p><strong>Methods</strong></p><p>The delivery method you can choose from checkout page to determine how quickly your ordered item will be delivered to your doorstep.</p><p>We process one delivery address for one order. So please mention your desired shipping address in detail where you want to get delivery.&nbsp;Home delivery is available.</p><p><strong>Delivery Charge</strong></p><p><strong>Inside Dhaka</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;WeightShipping chargesShipping&nbsp;Method</strong>Up to 1 kg&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;BDT 80Regular (3-5 business days)&nbsp;&nbsp;&nbsp;</p><p><strong>Outside Dhaka</strong></p><p><strong>Shipping Charge (below&nbsp;BDT 6,000)WeightShipping chargesShipping&nbsp;Method</strong>Up to 1 kg&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;BDT&nbsp;130Regular( 5-7 business days)</p><p>** For additional weight after one kg additional 20 TK charge will applicable for per kg weight up to 5 KGs ** Any order placed after 5 pm will be considered as order of next business day, not as same day. ** Business Day: Sunday to Thursday except public holidays.</p><p>** Product colour may slightly vary due to photographic lighting or your monitor settings.</p><p><br></p><h2><br></h2>', '<h1 class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">What information do we collect?</strong></h1><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">When you visit the ‘Kaaruj Bangladesh’ website and its subpages, place an order, make a purchase, contact us or participate in any activities we conduct, we collect your identifiable information, viz.: name, email address, phone number, etc. We also maintain records of your history and interests to improve your shopping experience.&nbsp;</span></p><h2 class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">How we collect information:</strong></h2><p class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">We collect personal information when you:</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Purchase, order, return or exchange products and services</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Register on our website or</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Track your order through our website</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Sign up for the Kaaruj Bangladesh newsletter</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Send or purchase a gift card</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Participate in our promotions or surveys</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">Contact us with a comment, question, or complaint</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">How we use the collected information:</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">We use your identifiable information to help us learn more about your shopping preferences and to provide you with the best possible products and services. In this regard, we may share your identifiable information with third parties that provide us support services or help us to market Kaaruj Bangladesh products and services. Third-parties are contractually prohibited from using your identifiable information in any manner other than helping Kaaruj Bangladesh. We may share your personal information if necessary to comply with laws, government requests or to protect the rights of Kaaruj Bangladesh.</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">We may use your identifiable information to send periodic emails to provide you with information and updates regarding Kaaruj Bangladesh new arrivals, campaigns, and any other activities. However, if you prefer to no longer receive emails from us, you can unsubscribe following the instructions at the bottom of each of our emails.</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">Cookies:</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">We use “cookie” technology that allows our Kaaruj.com to recognize your browser, distinguish you from other customers, and enhance and personalize your online shopping experience. Cookies help us remember and process the items in your shopping cart, understand and save your preferences for future visits, and compile aggregate data about site traffic and site interaction so that we can improve our website design, products, services, and campaigns. If you prefer, you can change the settings on your browser to prevent cookies from being stored.</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">Third-party policy:</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">We may pass your details (Name, email address, phone number) to other companies affiliated with us (for different service providing issues) only for the purpose of providing you better service. We may somewhat pass your details to our agents and subcontractors to help with analyzing data and providing us with marketing or customer service assistance. We may also use third parties to assist us with delivering products to you and to help us to collect payments (cash on delivery) from you. In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.</span></p><p><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</span></p><p><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">Security of your information:</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered, or destroyed. We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service. Visit our Terms and Conditions page to learn more about our complete terms of service.</span></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">Your right to withdraw &amp; change:</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">If you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use, or disclosure of your information and if you would like to access, correct, amend or delete any personal information we have about you, register a complaint, or simply want more information contact us at</span><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\"><em> info.kaaruj@gmail.com</em></strong></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); background-color: transparent;\">What information we collect:</strong></p><p class=\"ql-align-justify\"><span style=\"color: rgb(51, 51, 51); background-color: transparent;\">When you visit ‘Kaaruj Bangladesh’ website and its subpages, place an order, make a purchase, contact us or participate in any activities we conduct, we collect your identifiable information, viz.: name, email address, phone number, etc. We also maintain records of your history and interests to improve your shopping experience.</span></p><h2 class=\"ql-align-justify\"><strong style=\"color: rgb(51, 51, 51); bac