 resolve a complaint regarding the site or to receive further information regarding the use</p><p>of the Site, please contact us at</p><p>KAARUJ BANGLADESH</p><p>House 148, Road 5, Bashundhara RIA Dhaka,</p><p>Dhaka Division, Bangladesh.</p><p>Dhaka, Bangladesh 1229</p><p>Bangladesh</p><p>Phone: 01980907892</p><p>officialakaaruj.com</p>', '<h1 class=\"ql-align-center\"><strong>What information do we collect?</strong></h1><p>When you visit the ‘Kaaruj Bangladesh’ website and its subpages, place an order, make a purchase, contact us or participate in any activities we conduct, we collect your identifiable information, viz.: name, email address, phone number, etc. We also maintain records of your history and interests to improve your shopping experience.</p><h2><strong>How we collect information:</strong></h2><p><strong>We collect personal information when you:</strong></p><p>Purchase, order, return or exchange products and services</p><p>Register on our website or</p><p>Track your order through our website</p><p>Sign up for the Kaaruj Bangladesh newsletter</p><p>Send or purchase a gift card</p><p>Participate in our promotions or surveys</p><p>Contact us with a comment, question, or complaint</p><p><strong>How we use the collected information:</strong></p><p>We use your identifiable information to help us learn more about your shopping preferences and to provide you with the best possible products and services. In this regard, we may share your identifiable information with third parties that provide us support services or help us to market Kaaruj Bangladesh products and services. Third-parties are contractually prohibited from using your identifiable information in any manner other than helping Kaaruj Bangladesh. We may share your personal information if necessary to comply with laws, government requests or to protect the rights of Kaaruj Bangladesh.</p><p>We may use your identifiable information to send periodic emails to provide you with information and updates regarding Kaaruj Bangladesh new arrivals, campaigns, and any other activities. However, if you prefer to no longer receive emails from us, you can unsubscribe following the instructions at the bottom of each of our emails.</p><p><strong>Cookies:</strong></p><p>We use “cookie” technology that allows our Kaaruj.com to recognize your browser, distinguish you from other customers, and enhance and personalize your online shopping experience. Cookies help us remember and process the items in your shopping cart, understand and save your preferences for future visits, and compile aggregate data about site traffic and site interaction so that we can improve our website design, products, services, and campaigns. If you prefer, you can change the settings on your browser to prevent cookies from being stored.</p><p><strong>Third-party policy:</strong></p><p>We may pass your details (Name, email address, phone number) to other companies affiliated with us (for different service providing issues) only for the purpose of providing you better service. We may somewhat pass your details to our agents and subcontractors to help with analyzing data and providing us with marketing or customer service assistance. We may also use third parties to assist us with delivering products to you and to help us to collect payments (cash on delivery) from you. In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.</p><p>However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</p><p><strong>Security of your information:</strong></p><p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered, or destroyed. We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service. Visit our Terms and Conditions page to learn more about our complete terms of service.</p><p><strong>Your right to withdraw &amp; change:</strong></p><p>If you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use, or disclosure of your information and if you would like to access, correct, amend or delete any personal information we have about you, register a complaint, or simply want more information contact us at<strong><em>&nbsp;info.kaaruj@gmail.com</em></strong></p><p><strong>What information we collect:</strong></p><p>When you visit ‘Kaaruj Bangladesh’&nbsp;website and its subpages, place an order, make a purchase, contact us or participate in any activities we conduct, we collect your identifiable information, viz.: name, email address, phone number, etc. We also maintain records of your history and interests to improve your shopping experience.</p><h2><strong>How we collect information</strong></h2><p><strong>We collect personal information when you:</strong></p><p>Purchase, order, return or exchange products and services</p><p>Register on our website or</p><p>Track your order through our website</p><p>Sign up for the Kaaruj Bangladesh newsletter</p><p>Send or purchase a gift card</p><p>Participate in our promotions or surveys</p><p>Contact us with a comment, question, or complaint</p><p><strong>How we use the collected information:</strong></p><p>We use your identifiable information to help us learn more about your shopping preferences and to provide you with the best possible products and services. In this regard, we may share your identifiable information with third parties that provide us support services or help us to market Kaaruj Bangladesh products and services. Third-parties are contractually prohibited from using your identifiable information in any manner other than helping Kaaruj Bangladesh. We may share your personal information if necessary to comply with laws, government requests or to protect the rights of Kaaruj Bangladesh.</p><p>We may use your identifiable information to send periodic emails to provide you with information and updates regarding Kaaruj Bangladesh new arrivals, campaigns, and any other activities. However, if you prefer to no longer receive emails from us, you can unsubscribe following the instructions at the bottom of each of our emails.</p><p><strong>Cookies:</strong></p><p>We use “cookie” technology that allows our&nbsp;Kaaruj.com&nbsp;to recognize your browser, distinguish you from other customers, and enhance and personalize your online shopping experience. Cookies help us remember and process the items in your shopping cart, understand and save your preferences for future visits, and compile aggregate data about site traffic and site interaction so that we can improve our website design, products, services and campaigns. If you prefer, you can change the settings on your browser to prevent cookies being stored.</p><p><strong>Third-party policy:</strong></p><p>We may pass your details (Name, email address, phone number) to other companies affiliated with us (for different service providing issues) only for the purpose of providing you better service. We may somewhat pass your details to our agents and subcontractors to help with analyzing data and providing us with marketing or customer service assistance. We may also use third parties to assist us with delivering products to you and to help us to collect payments (cash on delivery) from you. In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.</p><p>However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</p><p><strong>Security of your information:</strong></p><p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed. We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service. Visit our Terms and Conditions page to learn more about our complete terms of service.</p><p><strong>Your right to withdraw &amp; change:</strong></p><p>If you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use, or disclosure of your information and if you would like to access, correct, amend or delete any personal information we have about you, register a complaint, or simply want more information contact us at info.kaaruj@gmail.com</p><h2>&nbsp;</h2>', '<p><strong style=\"background-color: transparent; color: rgb(51, 51, 51);\">Return Policy</strong></p><ol><li><span style=\"background-color: transparent; color: rgb(51, 51, 51);\">After receiving the product You can check the product in front of the delivery man, if you have any problem with the product or if you get the wrong product you can return the product immediately to the delivery man.&nbsp;</span></li><li><span style=\"background-color: transparent; color: rgb(51, 51, 51);\">Or after receiving the product, if you have any problem with the product or if you get the wrong product you can inform us within 7 working days. We will exchange your product. Used products will not be exchanged.&nbsp;</span></li></ol><p><span style=\"background-color: transparent; color: rgb(51, 51, 51);\">The bag in which the product was delivered to you, You must pack and return the product in the same bag along with the invoice paper.&nbsp;</span></p><p><strong style=\"background-color: transparent; color: rgb(51, 51, 51);\">Refund policy</strong></p><ol><li><span style=\"background-color: transparent; color: rgb(51, 51, 51);\">After placing the order if you paid the payment through bkash. And if we can’t deliver your product. We will refund your money within 5 or 7 working days.</span></li><li><span style=\"background-color: transparent; color: rgb(51, 51, 51);\">&nbsp;After receiving the product, if you have any problem with the product or if you get the wrong product you can inform us within 7 working days. We will exchange your product. If we are unable to exchange your product we will refund your money. You have to return the product first. After receiving your returned product we will refund your money within 5 or 7 working days. The product must be in saleable condition and should not be used.</span></li></ol><p><span style=\"background-color: transparent; color: rgb(51, 51, 51);\">&nbsp;</span></p><h2><strong style=\"background-color: transparent; color: rgb(51, 51, 51);\">Need help?</strong></h2><h2><span style=\"background-color: transparent; color: rgb(51, 51, 51);\">Contact us at officialakaaruj.com for questions related to refunds and returns.</span><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">..</span></h2>', 'kaaruj@admin.com', '01730127062', 'Dhaka,bangladesh', 2695, 1, 33, 141, 173);
